function format(value) {
    let format;
    if(value) {
        if (Math.abs(value) >= 1000) {
            format = ",.0f";
        } else if (Math.abs(value) >= 10) {
            format = ",.1f";
        } else if (Math.abs(value) >= 1) {
            format = ",.2f";
        } else {
            format = ",.3f";
        }
        let retval = Plotly.d3.format(format)(value);
        if (Number(retval) === 0) {
            retval = 0;
        }
        if (retval === '-0') {
            retval = '0';
        }
        return retval;
    }
    return value;
}

